// Customised hook 

import { useState , useEffect} from "react";
import axios from 'axios';

const UseFetch = () => {
    const [data, setData] = useState(null);
//'https://content.guardianapis.com/search?api-key=4aa45470-7bc3-4465-8327-49285e3bf381'
    useEffect(() => {
        setTimeout(() => {
            const fetchData = () => {
                axios.get('https://content.guardianapis.com/search?api-key=4aa45470-7bc3-4465-8327-49285e3bf381')
                    .then(res => {
                        console.log(res.data.response.results[1]);
                        setData(res.data.response.results)
                    });
            }

        }, 1000);
    })

    // console.log(data);

  return data
}

export default UseFetch
